import React, { useState, useEffect } from 'react';
import { ArrowLeft } from 'lucide-react';

const ResultsPage = () => {
  const [trafficData, setTrafficData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [debugInfo, setDebugInfo] = useState(null);

  useEffect(() => {
    const searchParams = new URLSearchParams(window.location.search);
    const name = searchParams.get('name');
    const address = searchParams.get('address');

    const fetchTrafficData = async () => {
      setDebugInfo(null);
      try {
        const corsProxy = 'https://cors-anywhere.herokuapp.com/';
        const besttimeUrl = `${corsProxy}https://besttime.app/api/v1/forecasts?` + 
          new URLSearchParams({
            api_key_private: 'pri_070565f833f9459aad223978a7a19b74',
            venue_name: name,
            venue_address: address
          });

        setDebugInfo(prev => ({ ...prev, besttimeUrl }));

        const response = await fetch(besttimeUrl, {
          headers: {
            'Origin': 'http://localhost:3000'
          }
        });
        if (!response.ok) {
          throw new Error(`HTTP error! status: ${response.status}`);
        }
        const data = await response.json();

        setDebugInfo(prev => ({ ...prev, besttimeResponse: data }));

        if (data.status !== 'OK') {
          throw new Error(data.message || 'Failed to fetch forecast data');
        }

        setTrafficData(data);
      } catch (err) {
        setError(err.message || 'Failed to fetch traffic data. Please try again later.');
        console.error('API Error:', err);
        setDebugInfo(prev => ({ ...prev, errorDetails: err.toString() }));
      } finally {
        setLoading(false);
      }
    };

    if (name && address) {
      fetchTrafficData();
    } else {
      setError('No venue information provided.');
      setLoading(false);
    }
  }, []);

  const formatDateTime = (dateTimeString) => {
    return new Date(dateTimeString).toLocaleString('en-US', {
      weekday: 'long',
      year: 'numeric',
      month: 'long',
      day: 'numeric',
      hour: '2-digit',
      minute: '2-digit'
    });
  };

  const handleBackClick = () => {
    window.history.back();
  };

  return (
    <div className="min-h-screen bg-gray-100 p-8">
      <div className="max-w-2xl mx-auto">
        <button 
          onClick={handleBackClick}
          className="flex items-center text-blue-600 hover:text-blue-800 mb-6"
        >
          <ArrowLeft className="mr-2" size={20} />
          Back to Search
        </button>

        {loading && (
          <div className="text-center text-gray-600">
            Loading traffic data...
          </div>
        )}

        {error && (
          <div className="text-center text-red-500 mb-4">
            Error: {error}
          </div>
        )}

        {trafficData && !loading && !error && (
          <div className="bg-white rounded-lg shadow-md p-6">
            <h1 className="text-2xl font-bold mb-4">{trafficData.venue_info.venue_name}</h1>
            <div className="mb-4">
              <h2 className="text-lg font-semibold mb-2">Address</h2>
              <p>{trafficData.venue_info.venue_address}</p>
            </div>
            {trafficData.analysis && (
              <div className="mb-4">
                <h2 className="text-lg font-semibold mb-2">Foot Traffic Forecast</h2>
                {trafficData.analysis.week_raw.map((day, index) => (
                  <p key={index}>
                    {['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday', 'Sunday'][index]}:
                    {day.day_raw.map(hour => hour.intensity).join(', ')}
                  </p>
                ))}
              </div>
            )}
            {trafficData.venue_info.venue_timezone && (
              <div className="mb-4">
                <h2 className="text-lg font-semibold mb-2">Time Zone</h2>
                <p>{trafficData.venue_info.venue_timezone}</p>
              </div>
            )}
            {trafficData.forecast_updated_on && (
              <div>
                <h2 className="text-lg font-semibold mb-2">Last Updated</h2>
                <p>{formatDateTime(trafficData.forecast_updated_on)}</p>
              </div>
            )}
          </div>
        )}

        <div className="mt-8 bg-gray-200 p-4 rounded">
          <h2 className="text-lg font-semibold mb-2">Debug Information</h2>
          <pre className="whitespace-pre-wrap">{JSON.stringify(debugInfo, null, 2)}</pre>
        </div>
      </div>
    </div>
  );
};

export default ResultsPage;
